//HTML constructor function
let constructor = function(array, score){
    let k = '<tbody>';
    array[0].forEach(element => {
        if(array[1].length !== 0){
            if( array[1].includes(element[4])){
                k += '<tr style="background-color: green;">';
                k += '<td>' + element[1] + '</td>';
                k += '<td>' + element[0] + '</td>';
                k += '<td>' + element[2] + '</td>';
                k += '<td>' + element[3] + '</td>';
                k += '<td>' + element[4] + '</td>';
                k += '<td style="text-align:center">' + score + '</td>';
                k += '</tr>';
            };
        }
        if(array[2].length !== 0){
            if ( array[2].includes(element[4])){
                k += '<tr style="background-color: red; padding: none; border: none">';
                k += '<td>' + element[1] + '</td>';
                k += '<td>' + element[0] + '</td>';
                k += '<td>' + element[2] + '</td>';
                k += '<td>' + element[3] + '</td>';
                k += '<td>' + element[4] + '</td>';
                k += '<td style="text-align:center">' + score + '</td>';
                k += '</tr>';
            };
        };
    });
    k += '</tbody>';
    document.getElementById('constructor').innerHTML = k;
};

