//HTML constructor
  const main = function(){
    //Filter function
    Object.filter = (obj, predicate) => 
      Object.assign(...Object.keys(obj)
                      .filter( key => predicate(obj[key]) )
                      .map( key => ({ [key]: obj[key] }) ) );
  
    //Filtering type eg. 'ANA'
    const filterByTypes = Object.filter(data['KMF'], x => x == type);
  
    //Filtering courses eg. 'mérnökinformatikus + *'
    const filterByCourse = Object.filter(data['Szak, szakpár'], x => x.includes(course));
  
    //Applying both and getting "goodKeys"
    const filteredData = function(){
      let goodKeys = [];
      let goodData = [];
      let justScores = [];
      for(let key1 in filterByTypes){
        for(let key2 in filterByCourse){
          if(key1===key2){
            goodKeys.push(key1);
          }
        }
      };
      //Getting neccessary data from dataset
      goodKeys.forEach(val => {
        if(data['Ponthatár'][val] !== -1 && data['Felvettek összesen'][val] !== 0){ //Getting rid 'empty' courses
        goodData.push([data['Szak, szakpár'][val],data['Kar kód'][val],data['Jelentkezők/Első helyen'][val],data['Felvettek összesen'][val],data['Ponthatár'][val]]);
        justScores.push(data['Ponthatár'][val]);
        }
      });
      let output = [goodData, justScores];
  
      //Sorting values into "accepted" and "declined" by user score
      let declined = [];
      let accepted = [];

      const [small, large] =
        output[1]
            .reduce((result, element) => {
            result[element <= score ? 0 : 1].push(element);
            return result;
        },
        [[], []]);
      declined = large;
      accepted = small;

      user_data = [output[0], accepted, declined]
      console.log(user_data);
      return user_data;
    };
    filteredData();
    
  };

//Event handler
let button = document.getElementById("btnCalcPont")
button.addEventListener("click", function(){
        if(document.getElementById("divPontSzam").innerHTML !== ''){
            //Grabbing user score from calculator
            let pont = document.getElementById("divPontSzam").innerHTML;
            //Timeout important to functionality
            setTimeout(() => {
                //Adding skeleton table to div
                let table = '<table style="width:100%; height:100%; background-color: silver; font-size: 16px; color: white; border: none"><tbody id="constructor"></tbody></table>'
                document.getElementById("divPontSzam").innerHTML = table;

                //Using main and constructor function
                t = document.getElementById('jMegId');
                typeAndCourse = t.options[t.selectedIndex].text;

                type = typeAndCourse.slice(1, 4);
                course = typeAndCourse.slice(5).trim().replace(/ *\([^)]*\) */g, "");
                score = pont;

                main();
                constructor(user_data, score);
                button.addEventListener("click", function(){
                    document.getElementById('divPontSzam').innerHTML = '';
                });
            }, 1500);
            //Reset
        } else {
            button.addEventListener("click", function(){
                document.getElementById('divPontSzam').innerHTML = '';
        });
        }
});

